import './Upload.css'

class Upload extends Component {
    constructor(props) {
      super(props)
    }
  
    render() {
      return (
        <div className="Upload">
            <span className="Title">Upload Files</span>
            <div className="Content">
                <div />
                <div className="Files" />
            </div>
            <div className="Actions" />
        </div>
      )
    }
  }
